            interest_2019 = item['number_value']
        elif item['category'] == 'Interest income ' and item['header1'] == '2018':
            interest_2018 = item['number_value']
    # Check if scale is provided for the 2019 and 2018 values
    # If scale is 'million', we need to adjust the values accordingly
    interest_2019_scale = next((item['scale'] for item in value_list if item['category'] == 'Interest income ' and item['header1'] == '2019'), '')
    interest_2018_scale = next((item['scale'] for item in value_list if item['category'] == 'Interest income ' and item['header1'] == '2018'), '')

    # If both have 'million' scale, convert to same unit (already in millions)
    if interest_2019_scale == 'million' and interest_2018_scale == 'million':
        change = interest_2019 - interest_2018
        return (change, 'million')
    elif interest_2019_scale == 'million' or interest_2018_scale == 'million':
        # Adjust to millions
        if interest_2019_scale == 'million':
            interest_2019 = interest_2019
        else:
            interest_2019 = interest_2019 * 1000000
        if interest_2018_scale == 'million':
            interest_2018 = interest_2018
        else:
            interest_2018 = interest_2018 * 1000000
        change = interest_2019 - interest_2018
        return (change / 1000000, 'million')
    else:
        change = interest_2019 - interest_2018
        return (change, '')

